script: |
  super -f text -I q11632.spq | sort > q11632.out

inputs:
  - name: q11632.spq
    data: |
      SELECT DISTINCT - cor0.col2 FROM tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet);
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q11632.out
    data: |
      -1
      -33
      -82
